import ApiCallBack from './FetchApi'
import * as apis from './Constants'

let URL = apis.url,
    parth = apis.EmployeeRegit

const EmployeeRegiterApi = async (data) => {
    console.log({URL,parth})
    return await ApiCallBack(URL, parth, data)
}

export default EmployeeRegiterApi
